Fifty Dead Men Walking (2008)  

Verenigd Koninkrijk / Canada
Actie / Thriller
117 minuten

geregisseerd door Kari Skogland
met Jim Sturgess, Rose McGowan en Ben Kingsley

Eind jaren 80: De Britse politie recruteert de 22-jarige Martin McGartland uit West Belfast om de IRA te bespioneren. Hij weet een plek binnen de terreurgroep te bemachtigen door zich aan te melden als vrijwilliger. Intussen speelt hij belangrijke informatie door aan de politie waardoor hij vele levens redt.

Vanaf 20 augustus in de bioscoop



